import React from 'react';
import  Professional from './Professional';
import  Personal from './Personal';
import  Upload from './Upload';
import  Varification from './Varification';
import { Route, Switch } from 'react-router-dom';


const App = () => {

    return (
              <>
                     <div className="container">
                         <div className="row">


                         <div class="btn-group" role="group" aria-label="Basic checkbox toggle button group">
  <input type="checkbox" class="btn-check" id="btncheck1" autocomplete="off"/>
  <label class="btn btn-outline-primary" for="btncheck1"><a href="/Personal">Personal</a></label>

  <input type="checkbox" class="btn-check" id="btncheck1" autocomplete="off"/>
  <label class="btn btn-outline-primary" for="btncheck1"><a href="/Professional">Professional</a></label>

  <input type="checkbox" class="btn-check" id="btncheck2" autocomplete="off"/>
  <label class="btn btn-outline-primary" for="btncheck2"><a href="/Upload">Upload</a></label>

  <input type="checkbox" class="btn-check" id="btncheck3" autocomplete="off"/>
  <label class="btn btn-outline-primary" for="btncheck3"><a href="/Varification">Varification</a></label>
</div>

                         </div>
                     </div>
                 

               
                <Switch>
                    <Route exact path="/Personal" component={Personal}/>
                    <Route exact path="/Professional" component={Professional}/>
                    <Route exact path="/Upload" component={Upload}/>
                    <Route exact path="/Varification" component={Varification}/>
                </Switch>
                
              </>

    );
}
export default App;
